import React, { useState } from 'react';
import './SystemSettings.css'; // Import CSS

const SystemSettings = () => {
  const [selectedSection, setSelectedSection] = useState('ai-parameters');
  const [notifications, setNotifications] = useState({
    email: false,
    sms: false,
    push: false,
    systemAlerts: false,
  });

  const toggleNotification = (type) => {
    setNotifications((prev) => ({
      ...prev,
      [type]: !prev[type],
    }));
  };

  return (
    <div className="settings-container">
      {/* Sidebar Navigation */}
      <aside className="settings-sidebar">
        <h2>System Settings</h2>
        <ul>
          {['ai-parameters', 'security-settings', 'notifications', 'early-warning', 'alert-settings'].map((section) => (
            <li key={section}>
              <button
                className={selectedSection === section ? 'active' : ''}
                onClick={() => setSelectedSection(section)}
              >
                {section.replace('-', ' ').toUpperCase()}
              </button>
            </li>
          ))}
        </ul>
      </aside>

      {/* Main Content */}
      <main className="settings-content">
        {selectedSection === 'ai-parameters' && (
          <section>
            <h3>AI Parameters</h3>
            <label>Sentiment Analysis Threshold:</label>
            <input type="range" min="0" max="100" />
            <label>Data Collection Frequency:</label>
            <select>
              <option>Daily</option>
              <option>Weekly</option>
              <option>Monthly</option>
            </select>
          </section>
        )}

        {selectedSection === 'security-settings' && (
          <section>
            <h3>Security Settings</h3>
            <label className="setting-item">
              <span>Enable 2FA Authentication</span>
              <input type="checkbox" className="styled-checkbox" />
            </label>
            <label>Whitelisted IP:</label>
            <input type="text" placeholder="Enter IP" />
          </section>
        )}

        {selectedSection === 'notifications' && (
          <section>
            <h3>Notification Preferences</h3>
            {Object.keys(notifications).map((type) => (
              <div className="toggle-container" key={type}>
                <span>{type.replace(/([A-Z])/g, ' $1')}</span>
                <label className="switch">
                  <input type="checkbox" checked={notifications[type]} onChange={() => toggleNotification(type)} />
                  <span className="slider round"></span>
                </label>
              </div>
            ))}
          </section>
        )}

        {selectedSection === 'early-warning' && (
          <section>
            <h3>Early Warning Dashboard</h3>
            <label className="setting-item">
              <span>Enable Early Warnings</span>
              <input type="checkbox" className="styled-checkbox" />
            </label>
            <label>Threshold Limit:</label>
            <input type="number" min="1" max="100" />
          </section>
        )}

        {selectedSection === 'alert-settings' && (
          <section>
            <h3>Alert Settings</h3>
            <label className="setting-item">
              <span>Enable Critical Alerts</span>
              <input type="checkbox" className="styled-checkbox" />
            </label>
            <label>Alert Sound:</label>
            <select>
              <option>Beep</option>
              <option>Chime</option>
              <option>Silent</option>
            </select>
          </section>
        )}
      </main>
    </div>
  );
};

export default SystemSettings;
